import React from 'react';
import Header from '../header';
import BurgerMenu from '../burger-menu';

export default class App extends React.Component {
    openrr;
    onBtnHandler = () => {
        console.log('test');
    }
    toggleBurgerMenu = (openrr) => {
        openrr = !openrr;
    }
    render() {
        this.onBtnHandler = () => {
            console.log('test');
        }
        return (
            <div>
                <Header 
                    onBtnClickHandler = {this.onBtnHandler} />
                <BurgerMenu
                    open = {this.toggleBurgerMenu} />
            </div>
        );
    };
};
